package javapackage;

public class Typecasting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		//Widening Casting (automatically)
		
		long myheritance = 1485555555L;
		int myqwer = 154;
		System.out.println(myqwer);
		System.out.println(myheritance);
		
		
		//narrowing casting(manually)
		
		double myice = 15.487545d;
		char mychlm = 'a';
		System.out.println(myice);
		System.out.println(mychlm);
		
		
	}

}
